import React from 'react'
import Navbar from './Navbar'
import $footer from "../assets/footer-cropped.png";
import titleGoldBg from "../assets/LOH_LONG_CURVED_COLOR_2.png";
import rectangle8 from "../assets/rectangle8.png";
import { useState } from 'react';

function Vote() {

    const [slideValue, setSlideValue] = useState('')

    const handleSliderChange = e => setSlideValue(e.target.value)

    console.log(slideValue);

  return (
    <div className='base'>
       <Navbar />
          <div>
            <img className="connect-title-gold-bg" src={titleGoldBg}/>
          </div>
          <div className='container'>
            <div className='holder'>
                <div className='row'>
                    <div className='col'>
                        <img className='img-fluid' src={rectangle8} />
                    </div>
                    <div className='col'>
                    <div className='input-holder p-3'>
                            <p className='range-slider-text'>Entry Proposal Look</p>
                            <input type="range" className="form-range" min="0" max="10" step='1' onChange={handleSliderChange}></input>
                        </div>
                    </div>
                </div>
            </div>
          </div>
          <img className="footer" src={$footer} />
    </div>
  )
}

export default Vote
